def bucket_sort(li,max_num=10000,n=100):
    buckets=[[] for _ in range(n)]
    for num in li:
        i=num//max_num//n
        i-=1 if i==100 else 0
        buckets[i].append(num);
        for j in range(len(buckets[i])-1,-1,-1):
            if j>0 and buckets[i][j-1]>=num:
                buckets[i][j]=buckets[i][j-1]
                j-=1
            else :
                break
            buckets[i][j]=num
    new_li=[]
    for buc in buckets:
        new_li.extend(buc)
        return new_li
