def quick_sort(li,left=0,right=len(test_li)-1):
    if left < right:
        mid=partition(li,left,right)
        quick_sort(li,left,mid-1)
        quick_sort(li,mid+1,right)
def partition(li,left,right):
    tmp=li[left];i=left;j=right
    while j>i:
        while j>i and li[j]>=tmp:
            j-=1
        li[i]=li[j]
        while j> i and li[i]<=tmp:
            i+=1
        li[j]=li[i]
    li[i]=tmp
    return i
